import './Project.css'
import {Swiper, SwiperSlide} from 'swiper/react'

const Project = () => {
  return (
    <div className='project'>
        {/* heading */}
        <span>Recent Projects</span>
        <span>PortFolio</span>
        {/* slider */}
        <Swiper>
            <SwiperSlide>
                
            </SwiperSlide>
        </Swiper>
    </div>
  )
}

export default Project
